Here's a simple TypeScript function that adds two numbers:

```typescript
function addNumbers(a: number, b: number): number {
    return a + b;
}

// Example usage:
const result = addNumbers(5, 3);
console.log(result); // Output: 8
```

You can also write it as an arrow function:

```typescript
const addNumbers = (a: number, b: number): number => {
    return a + b;
};

// Or even more concise:
const addNumbers = (a: number, b: number): number => a + b;

// Example usage:
const result = addNumbers(10, 7);
console.log(result); // Output: 17
```

**Key TypeScript features demonstrated:**
- **Parameter types**: `a: number, b: number` - specifies that both parameters must be numbers
- **Return type**: `: number` - specifies that the function returns a number
- **Type safety**: TypeScript will give you an error if you try to pass non-number values

**Example with error handling:**
```typescript
function addNumbers(a: number, b: number): number {
    if (typeof a !== 'number' || typeof b !== 'number') {
        throw new Error('Both parameters must be numbers');
    }
    return a + b;
}
```

The TypeScript compiler will catch type errors at compile time, making your code more robust!

